{
  "translationLines": [
    {
      "lineNumber": 158761,
      "originalJapaneseLine": "「ふっ――ッ！」",
      "translatedEnglishLine": "\"Huh――!\""
    },
    {
      "lineNumber": 158762,
      "originalJapaneseLine": "ハウゼルが羽を広げ空を飛ぼうとする。",
      "translatedEnglishLine": "Hauzel spread his wings and tried to fly into the sky."
    },
    {
      "lineNumber": 158763,
      "originalJapaneseLine": "「――きゃっ！？」",
      "translatedEnglishLine": "\"—Kya!?\""
    },
    {
      "lineNumber": 158764,
      "originalJapaneseLine": "しかし壁にぶつかり、動きが止まった。",
      "translatedEnglishLine": "But he hit the wall and his movement stopped."
    },
    {
      "lineNumber": 158765,
      "originalJapaneseLine": "「がはははは、馬鹿め！",
      "translatedEnglishLine": "\"Gahahahaha, you fool!"
    },
    {
      "lineNumber": 158766,
      "originalJapaneseLine": "　ここは鍾乳洞の中だぞ、自由には飛べまい！」",
      "translatedEnglishLine": "We're inside a limestone cave; you can't fly freely here!\""
    },
    {
      "lineNumber": 158767,
      "originalJapaneseLine": "「むむ……」",
      "translatedEnglishLine": "\"Hmm...\""
    },
    {
      "lineNumber": 158768,
      "originalJapaneseLine": "「ふっ！」",
      "translatedEnglishLine": "\"Huh!\""
    },
    {
      "lineNumber": 158769,
      "originalJapaneseLine": "ハウゼルが武器を構える。",
      "translatedEnglishLine": "Hauzel readied his weapon."
    },
    {
      "lineNumber": 158770,
      "originalJapaneseLine": "「ちょーーーーーっと待ったーーー！」",
      "translatedEnglishLine": "\"Waaaaait a mooooment!\""
    },
    {
      "lineNumber": 158771,
      "originalJapaneseLine": "「……なんですか？」",
      "translatedEnglishLine": "\"...What is it?\""
    },
    {
      "lineNumber": 158772,
      "originalJapaneseLine": "「お得意の火炎攻撃をするのは結構だが、",
      "translatedEnglishLine": "\"It's fine to use your specialty fire attack,"
    },
    {
      "lineNumber": 158773,
      "originalJapaneseLine": "　何か大事なことを忘れてやしないか？」",
      "translatedEnglishLine": "but aren't you forgetting something important?\""
    },
    {
      "lineNumber": 158774,
      "originalJapaneseLine": "「ここにある本が燃えてしまってもいいのかなー？」",
      "translatedEnglishLine": "\"Is it okay if the books here get burned down?\""
    },
    {
      "lineNumber": 158775,
      "originalJapaneseLine": "「あっ……！」",
      "translatedEnglishLine": "\"Ah...!\""
    },
    {
      "lineNumber": 158776,
      "originalJapaneseLine": "「いいのかなー？　灰となったが最後、",
      "translatedEnglishLine": "\"Is that really okay? Once they turn to ashes,"
    },
    {
      "lineNumber": 158777,
      "originalJapaneseLine": "　もう二度と入手不可能な貴重な本だが、",
      "translatedEnglishLine": "these precious books can never be obtained again,"
    },
    {
      "lineNumber": 158778,
      "originalJapaneseLine": "　本当に燃やしてしまってもいいのかなー？」",
      "translatedEnglishLine": "are you sure you want to burn them for good?\""
    },
    {
      "lineNumber": 158779,
      "originalJapaneseLine": "「くっ……！」",
      "translatedEnglishLine": "\"Kuh...!\""
    },
    {
      "lineNumber": 158780,
      "originalJapaneseLine": "「がははは、分かったら",
      "translatedEnglishLine": "\"Gahahaha, now that you understand,"
    },
    {
      "lineNumber": 158781,
      "originalJapaneseLine": "　大人しくしていてもらおうか！」",
      "translatedEnglishLine": "you better behave!\""
    },
    {
      "lineNumber": 158782,
      "originalJapaneseLine": "「……卑怯な！」",
      "translatedEnglishLine": "\"...That's unfair!\""
    },
    {
      "lineNumber": 158783,
      "originalJapaneseLine": "「くっ……！」",
      "translatedEnglishLine": "\"Kuh...!\""
    },
    {
      "lineNumber": 158784,
      "originalJapaneseLine": "（さすがに炎と飛行を封じられて、",
      "translatedEnglishLine": "(With both fire and flight sealed off,"
    },
    {
      "lineNumber": 158785,
      "originalJapaneseLine": "　この人数を相手にするのは……）",
      "translatedEnglishLine": "to take on this many opponents is...)"
    },
    {
      "lineNumber": 158786,
      "originalJapaneseLine": "（仕方ない……",
      "translatedEnglishLine": "(It can't be helped..."
    },
    {
      "lineNumber": 158787,
      "originalJapaneseLine": "　ここは一旦引いて……）",
      "translatedEnglishLine": "I'll have to retreat for now...)"
    },
    {
      "lineNumber": 158788,
      "originalJapaneseLine": "「あっ、逃げようとしてるわ！」",
      "translatedEnglishLine": "\"Ah, he's trying to escape!\""
    },
    {
      "lineNumber": 158789,
      "originalJapaneseLine": "「サーーーーークラ！」",
      "translatedEnglishLine": "\"Sakuuuuura!\""
    },
    {
      "lineNumber": 158790,
      "originalJapaneseLine": "「あーーーーーーっ！」",
      "translatedEnglishLine": "\"Aaaaaaaaah!\""
    },
    {
      "lineNumber": 158791,
      "originalJapaneseLine": "「へ？」",
      "translatedEnglishLine": "\"Huh?\""
    },
    {
      "lineNumber": 158792,
      "originalJapaneseLine": "「ドラゴンパッチ最新刊が",
      "translatedEnglishLine": "\"The latest volume of Dragon Patch"
    },
    {
      "lineNumber": 158793,
      "originalJapaneseLine": "　もう残りわずかだわー！（棒読み）」",
      "translatedEnglishLine": "is almost sold out! (monotone)\""
    },
    {
      "lineNumber": 158794,
      "originalJapaneseLine": "「ええっ！？」",
      "translatedEnglishLine": "\"Eh!?\""
    },
    {
      "lineNumber": 158795,
      "originalJapaneseLine": "「こんな戦いが始まって逃げ出したいけど、",
      "translatedEnglishLine": "\"This kind of fight is starting and I want to run away,"
    },
    {
      "lineNumber": 158796,
      "originalJapaneseLine": "　私は命がけでも並ぶわー！（棒読み）」",
      "translatedEnglishLine": "but I'll risk my life to line up! (monotone)\""
    },
    {
      "lineNumber": 158797,
      "originalJapaneseLine": "「だって……（棒読み）」",
      "translatedEnglishLine": "\"Because... (monotone)\""
    },
    {
      "lineNumber": 158798,
      "originalJapaneseLine": "「今回を逃せば二度と手に入らない！",
      "translatedEnglishLine": "\"If you miss this chance, you won't get it again!"
    },
    {
      "lineNumber": 158799,
      "originalJapaneseLine": "　貴重な本なのですからー！（棒読み）」",
      "translatedEnglishLine": "It's a precious book! (monotone)\""
    },
    {
      "lineNumber": 158800,
      "originalJapaneseLine": "「あっ、うっ……ぐううう……！」",
      "translatedEnglishLine": "\"Ah, ugh... guuuu...!\""
    },
    {
      "lineNumber": 158801,
      "originalJapaneseLine": "「おっ、動きが止まった！」",
      "translatedEnglishLine": "\"Oh, his movements have stopped!\""
    },
    {
      "lineNumber": 158802,
      "originalJapaneseLine": "「ナイスだ、サクラ！」",
      "translatedEnglishLine": "\"Nice, Sakura!\""
    },
    {
      "lineNumber": 158803,
      "originalJapaneseLine": "「どうも」",
      "translatedEnglishLine": "\"Thanks.\""
    },
    {
      "lineNumber": 158804,
      "originalJapaneseLine": "「がははははははは！",
      "translatedEnglishLine": "\"Gahahahahahaha!"
    },
    {
      "lineNumber": 158805,
      "originalJapaneseLine": "　今のうちにやっつけろー！」",
      "translatedEnglishLine": "Take him out while you can!\""
    },
    {
      "lineNumber": 158806,
      "originalJapaneseLine": "「はあはあ、飛行も火炎も封じたとはいえ、",
      "translatedEnglishLine": "\"Huff huff, even though we've sealed his flight and fire,"
    },
    {
      "lineNumber": 158807,
      "originalJapaneseLine": "　さすがに苦労させられるぜ……」",
      "translatedEnglishLine": "he's still giving us quite a hard time...\""
    },
    {
      "lineNumber": 158808,
      "originalJapaneseLine": "「ランス様、大丈夫ですか？",
      "translatedEnglishLine": "\"Lord Rance, are you alright?"
    },
    {
      "lineNumber": 158809,
      "originalJapaneseLine": "　いたいのいたいの、とんでけー」",
      "translatedEnglishLine": "Pain, pain, go fly away!\""
    },
    {
      "lineNumber": 158810,
      "originalJapaneseLine": "「おお、治る治るー」",
      "translatedEnglishLine": "\"Oh, feeling better, feeling better—\""
    },
    {
      "lineNumber": 158811,
      "originalJapaneseLine": "「さーて、どんな気持ちかな？",
      "translatedEnglishLine": "\"Alright, how do you feel now?"
    },
    {
      "lineNumber": 158812,
      "originalJapaneseLine": "　ええ、ハウゼル君」",
      "translatedEnglishLine": "Yes, Hauzel-kun.\""
    },
    {
      "lineNumber": 158813,
      "originalJapaneseLine": "ランスの視線の先には",
      "translatedEnglishLine": "Ahead of Lance's gaze,"
    },
    {
      "lineNumber": 158814,
      "originalJapaneseLine": "片膝をついているハウゼルがいた。",
      "translatedEnglishLine": "was Hauzel, kneeling on one knee."
    },
    {
      "lineNumber": 158815,
      "originalJapaneseLine": "「くっ……卑怯な……」",
      "translatedEnglishLine": "\"Kuh... that's unfair...\""
    },
    {
      "lineNumber": 158816,
      "originalJapaneseLine": "「がははは！",
      "translatedEnglishLine": "\"Gahahaha!"
    },
    {
      "lineNumber": 158817,
      "originalJapaneseLine": "　勝てば官軍という言葉を知らんのか君は！」",
      "translatedEnglishLine": "Don't you know the phrase 'To the victor go the spoils'?!\""
    },
    {
      "lineNumber": 158818,
      "originalJapaneseLine": "「さあ、観念して負けを認めるがいい」",
      "translatedEnglishLine": "\"Now, surrender and admit your defeat.\""
    },
    {
      "lineNumber": 158819,
      "originalJapaneseLine": "カオスの切っ先が",
      "translatedEnglishLine": "The tip of Chaos's blade"
    },
    {
      "lineNumber": 158820,
      "originalJapaneseLine": "ハウゼルの喉元に突きつけられる。",
      "translatedEnglishLine": "was pressed against Hauzel's throat."
    }
  ]
}

